import './App.css';
import Image from './grocery1.jpg';
import ImageTwo from './grocery2.jpg';

function App() {
  return (
  <div className='app'>
    <img src = { Image } width='250px' alt='Shopping'/>
    <h1>Grocery List</h1>
    <img src = { ImageTwo } width='250px' alt='Man Shopping'/>

  </div>
  );
}

export default App;
